✧ ✧ ℍ𝕖𝕪 𝕞𝕪 𝕆𝕨𝕝𝕤🦉 ✧ ✧

Zelda awakening que dire a part que cette revisite est purement et simplement une réussite.🗡🙆‍♀️
✧ ✧

Un réel plaisir de jouer au jeu, pour être honnête je ne suis pas une fan de Zelda à part l'opus sur gamecube Windwaken. 
Du coup je ne redécouvre pas le jeu mais j'imagine le plaisir des fans face à cet opus qui est frais comme tout. Alors oui les mauvaises langues diront que Nintendo nous ressort du réchauffer au lieu d'innover mais franchement quand quelque chose marche pourquoi en changer?  Il faut s'armer de patiente pour résoudre les différentes énigmes dans les donjons. Je suis conquise et avance petit a petit vers la fin du jeu. 🍂❤ J'ai en ma possession 4 instruments donc la moitié afin de réveiller le poisson rêve.🐟🥚 ✧ ✧

Bon début de semaine/ Have a nice week 💋

